module NewYorkEducation
  class JsonToValidRecord

    def initialize(records)
      @records = records
    end

    def valid_records
      records_without_unnecessary_nodes = remove_unnecessary_nodes(@records)
      individual_year_records = [{}, {}, {}, {}]
      records_without_unnecessary_nodes.each do |key, value|
        value.each_with_index do |year, index|
          individual_year_records[index].merge!(year)
        end
      end
      remove_unnecessary_keys(individual_year_records).map do |year|
        replace_invalid_keys(year)
      end
    end

    def remove_unnecessary_nodes(json_record)
      nodes = ["schools", "es_admissions", "ms_admissions", "hs_admissions", "city_average"]
      nodes.each do |node|
        json_record.delete(node)
      end
      return json_record
    end

    def remove_unnecessary_keys(records)
      unnecessary_keys = ["id", "created_at", "updated_at", :id, :created_at, :updated_at]
      unnecessary_keys.each do |unnecessary_key|
        records.map do |record|
          record.delete_if { |key, value| key == unnecessary_key }
        end
      end
      records
    end

    def replace_invalid_keys(record)
      Hash[record.map {|k, v| [mappings[k] || k.to_sym, v] }]
    end

